// navber scoll
var navbar = document.getElementById("navbar");
var prevScrollpos = window.pageYOffset;
window.onscroll = function () {
  var currentScrollPos = window.pageYOffset;
  if (prevScrollpos > currentScrollPos) {
    if (navbar) {
      navbar.style.top = "-200px";
    }
  } else {
    if (navbar) {
      navbar.style.top = "0px";
    }
  }
  prevScrollpos = currentScrollPos;
};

//tooltip
var tooltips = document.querySelectorAll(".tooltips");
tooltips.forEach(function (t) {
  new bootstrap.Tooltip(t);
});

// search select field

var selectBox = document.querySelector(".select-box");
var selectOption = document.querySelector(".select-option");
var soValue = document.querySelector("#soValue");
var optionSearch = document.querySelector("#optionSearch");
var options = document.querySelector(".options");
var optionslist = document.querySelectorAll(".options li");
if (selectOption) {
  selectOption.addEventListener("click", function () {
    selectBox.classList.toggle("active");
  });
}
optionslist.forEach(function (optionsListSingle) {
  optionsListSingle.addEventListener("click", function () {
    text = this.textContent;
    soValue.value = text;
    selectBox.classList.remove("active");
  });
});
if (optionSearch) {
  optionSearch.addEventListener("keyup", function () {
    var filter;
    var li;
    var textValue;
    filter = optionSearch.value.toUpperCase();
    li = options.getElementsByTagName("li");
    for (var i = 0; i < li.length; i++) {
      liCount = li[i];
      textValue = liCount.textContent || liCount.innerText;
      if (textValue.toUpperCase().indexOf(filter) > -1) {
        li[i].style.display = "";
      } else {
        li[i].style.display = "none";
      }
    }
  });
}

// product quantity increment
